import React from 'react';
import { NavLink } from 'react-router-dom';



function Navbar () {


    return(
        <aside>
            <ul>
                <NavLink to='/addfood'>Add Food</NavLink> <></>
                <NavLink to='/seefood'>See Food</NavLink><></>
                <NavLink to='/findfood'>Find Food</NavLink>


            </ul>

        </aside>

    )

}

export default Navbar;
